(336,	'/js/admin_menu/cache/1371bef3dac947db195f4a0e1d6f1d3a',	'default',	'',	'',	'7.59'),
(337,	'/admin/modules',	'default',	'Field type(s) in use - see <a href=\"@fields-page\">Field list</a>',	'',	'7.59'),
(338,	'/admin/modules',	'default',	'Administration and debugging functionality for developers and site builders.',	'',	'7.59'),
(339,	'/admin/modules',	'default',	'Enable',	'',	'7.59'),
(340,	'/admin/modules',	'default',	'@module (<span class=\"admin-enabled\">enabled</span>)',	'',	'7.59'),
(341,	'/admin/modules',	'default',	'The administration menu module provides a dropdown menu arranged for one- or two-click access to most administrative tasks and other common destinations (to users with the proper permissions). Administration menu also displays the number of anonymous and authenticated users, and allows modules to add their own custom menu items. Integration with the menu varies from module to module; the contributed module <a href=\"@drupal\">Devel</a>, for instance, makes strong use of the administration menu module to provide quick access to development tools.',	'',	'7.59'),
(342,	'/admin/modules',	'default',	'The administration menu <a href=\"@settings\">settings page</a> allows you to modify some elements of the menu\'s behavior and appearance. Since the appearance of the menu is dependent on your site theme, substantial customizations require modifications to your site\'s theme and CSS files. See the advanced module README.txt file for more information on theme and CSS customizations.',	'',	'7.59'),
(343,	'/admin/modules',	'default',	'The menu items displayed in the administration menu depend upon the actual permissions of the viewer. First, the administration menu is only displayed to users in roles with the <em>Access administration menu</em> (admin_menu module) permission. Second, a user must be a member of a role with the <em>Access administration pages</em> (system module) permission to view administrative links. And, third, only currently permitted links are displayed; for example, if a user is not a member of a role with the permissions <em>Administer permissions</em> (user module) and <em>Administer users</em> (user module), the <em>User management</em> menu item is not displayed.',	'',	'7.59'),
(344,	'/admin/modules',	'default',	'Configure permissions',	'',	'7.59'),
(345,	'/admin/modules; modules/contextual/contextual.js',	'default',	'Configure',	'',	'7.59'),
(346,	'/admin/modules',	'default',	'Provides a dropdown menu to most administrative tasks and other common destinations (to users with the proper permissions).',	'',	'7.59'),
(347,	'/admin/modules',	'default',	'A better Toolbar.',	'',	'7.59'),
(348,	'/admin/modules',	'default',	'Aggregates syndicated content (RSS, RDF, and Atom feeds).',	'',	'7.59'),
(349,	'/admin/modules',	'default',	'About',	'',	'7.59'),
(350,	'/admin/modules',	'default',	'The Block module allows you to create boxes of content, which are rendered into an area, or region, of one or more pages of a website. The core Seven administration theme, for example, implements the regions \"Content\", \"Help\", \"Dashboard main\", and \"Dashboard sidebar\", and a block may appear in any one of these regions. The <a href=\"@blocks\">Blocks administration page</a> provides a drag-and-drop interface for assigning a block to a region, and for controlling the order of blocks within regions. For more information, see the online handbook entry for <a href=\"@block\">Block module</a>.',	'',	'7.59'),
(351,	'/admin/modules',	'default',	'Uses',	'',	'7.59'),
(352,	'/admin/modules',	'default',	'Positioning content',	'',	'7.59'),
(353,	'/admin/modules',	'default',	'When working with blocks, remember that all themes do <em>not</em> implement the same regions, or display regions in the same way. Blocks are positioned on a per-theme basis. Users with the <em>Administer blocks</em> permission can disable blocks. Disabled blocks are listed on the <a href=\"@blocks\">Blocks administration page</a>, but are not displayed in any region.',	'',	'7.59'),
(354,	'/admin/modules',	'default',	'Controlling visibility',	'',	'7.59'),
(355,	'/admin/modules',	'default',	'Blocks can be configured to be visible only on certain pages, only to users of certain roles, or only on pages displaying certain <a href=\"@content-type\">content types</a>. Administrators can also allow specific blocks to be enabled or disabled by users when they edit their <a href=\"@user\">My account</a> page. Some dynamic blocks, such as those generated by modules, will be displayed only on certain pages.',	'',	'7.59'),
(356,	'/admin/modules',	'default',	'Creating custom blocks',	'',	'7.59'),
(357,	'/admin/modules',	'default',	'Users with the <em>Administer blocks</em> permission can <a href=\"@block-add\">add custom blocks</a>, which are then listed on the <a href=\"@blocks\">Blocks administration page</a>. Once created, custom blocks behave just like default and module-generated blocks.',	'',	'7.59'),
(358,	'/admin/modules',	'default',	'@module (<span class=\"admin-disabled\">disabled</span>)',	'',	'7.59'),
(359,	'/admin/modules',	'default',	'Controls the visual building blocks a page is constructed with. Blocks are boxes of content rendered into an area, or region, of a web page.',	'',	'7.59'),
(360,	'/admin/modules',	'default',	'Enables multi-user blogs.',	'',	'7.59'),
(361,	'/admin/modules',	'default',	'Allows users to create and organize related content in an outline.',	'',	'7.59'),
(362,	'/admin/modules',	'default',	'The Color module allows users with the <em>Administer site configuration</em> permission to quickly and easily change the color scheme of themes that have been built to be compatible with it. For more information, see the online handbook entry for <a href=\"@color\">Color module</a>.',	'',	'7.59'),
(363,	'/admin/modules',	'default',	'Changing colors',	'',	'7.59'),
(364,	'/admin/modules',	'default',	'Using the Color module allows you to easily change the color of links, backgrounds, text, and other theme elements. To change the color settings for a compatible theme, select the <em>Settings</em> link for your theme on the <a href=\'@configure\'>Themes administration page</a>. If you don\'t see a color picker on that page, then your theme is not compatible with the color module. If you are sure that the theme does indeed support the color module, but the color picker does not appear, then <a href=\'@troubleshoot\'>follow these troubleshooting procedures</a>.',	'',	'7.59'),
(365,	'/admin/modules',	'default',	'The Color module saves a modified copy of the theme\'s specified stylesheets in the files directory. This means that if you make any manual changes to your theme\'s stylesheet, <em>you must save your color settings again, even if they haven\'t changed</em>. This step is required because the module stylesheets (in the files directory) need to be recreated to include your changes.',	'',	'7.59'),
(366,	'/admin/modules',	'default',	'Allows administrators to change the color scheme of compatible themes.',	'',	'7.59'),
(367,	'/admin/modules',	'default',	'The Comment module allows users to comment on site content, set commenting defaults and permissions, and moderate comments. For more information, see the online handbook entry for <a href=\"@comment\">Comment module</a>.',	'',	'7.59'),
(368,	'/admin/modules',	'default',	'Default and custom settings',	'',	'7.59'),
(369,	'/admin/modules',	'default',	'Each <a href=\'@content-type\'>content type</a> can have its own default comment settings configured as: <em>Open</em> to allow new comments, <em>Hidden</em> to hide existing comments and prevent new comments, or <em>Closed</em> to view existing comments, but prevent new comments. These defaults will apply to all new content created (changes to the settings on existing content must be done manually). Other comment settings can also be customized per content type, and can be overridden for any given item of content. When a comment has no replies, it remains editable by its author, as long as the author has a user account and is logged in.',	'',	'7.59'),
(370,	'/admin/modules',	'default',	'Comment approval',	'',	'7.59'),
(371,	'/admin/modules',	'default',	'Comments from users who have the <em>Skip comment approval</em> permission are published immediately. All other comments are placed in the <a href=\'@comment-approval\'>Unapproved comments</a> queue, until a user who has permission to <em>Administer comments</em> publishes or deletes them. Published comments can be bulk managed on the <a href=\'@admin-comment\'>Published comments</a> administration page.',	'',	'7.59'),
(372,	'/admin/modules',	'default',	'Allows users to comment on and discuss published content.',	'',	'7.59'),
(373,	'/admin/modules',	'default',	'Enables the use of both personal and site-wide contact forms.',	'',	'7.59'),
(374,	'/admin/modules',	'default',	'Allows content to be translated into different languages.',	'',	'7.59'),
(375,	'/admin/modules',	'default',	'The Contextual links module displays links related to regions of pages on your site to users with <em>access contextual links</em> permission. For more information, see the online handbook entry for <a href=\"@contextual\">Contextual links module</a>.',	'',	'7.59'),
(376,	'/admin/modules',	'default',	'Displaying contextual links',	'',	'7.59'),
(377,	'/admin/modules',	'default',	'Contextual links are supplied by modules, to give you quick access to tasks associated with regions of pages on your site. For instance, if you have a custom menu block displayed in a sidebar of your site, the Blocks and Menus modules will supply links to configure the block and edit the menu. The Contextual links module collects these links into a list for display by your theme, and also adds JavaScript code to the page to hide the links initially, and display them when your mouse hovers over the block.',	'',	'7.59'),
(378,	'/admin/modules',	'default',	'Provides contextual links to perform actions related to elements on a page.',	'',	'7.59'),
(379,	'/admin/modules',	'default',	'Provides a dashboard page in the administrative interface for organizing administrative tasks and tracking information within your site.',	'',	'7.59'),
(380,	'/admin/modules',	'default',	'The Database logging module logs system events in the Drupal database. For more information, see the online handbook entry for the <a href=\"@dblog\">Database logging module</a>.',	'',	'7.59'),
(381,	'/admin/modules',	'default',	'Monitoring your site',	'',	'7.59'),
(382,	'/admin/modules',	'default',	'The Database logging module allows you to view an event log on the <a href=\"@dblog\">Recent log messages</a> page. The log is a chronological list of recorded events containing usage data, performance data, errors, warnings and operational information. Administrators should check the log on a regular basis to ensure their site is working properly.',	'',	'7.59'),
(383,	'/admin/modules',	'default',	'Debugging site problems',	'',	'7.59'),
(384,	'/admin/modules',	'default',	'In case of errors or problems with the site, the <a href=\"@dblog\">Recent log messages</a> page can be useful for debugging, since it shows the sequence of events. The log messages include usage information, warnings, and errors.',	'',	'7.59'),
(385,	'/admin/modules',	'default',	'Logs and records system events to the database.',	'',	'7.59'),
(386,	'/admin/modules',	'default',	'The Field module allows custom data fields to be defined for <em>entity</em> types (entities include content items, comments, user accounts, and taxonomy terms). The Field module takes care of storing, loading, editing, and rendering field data. Most users will not interact with the Field module directly, but will instead use the <a href=\"@field-ui-help\">Field UI module</a> user interface. Module developers can use the Field API to make new entity types \"fieldable\" and thus allow fields to be attached to them. For more information, see the online handbook entry for <a href=\"@field\">Field module</a>.',	'',	'7.59'),
(387,	'/admin/modules',	'default',	'Enabling field types',	'',	'7.59'),
(388,	'/admin/modules',	'default',	'The Field module provides the infrastructure for fields and field attachment; the field types and input widgets themselves are provided by additional modules. Some of the modules are required; the optional modules can be enabled from the <a href=\"@modules\">Modules administration page</a>. Drupal core includes the following field type modules: Number (required), Text (required), List (required), Taxonomy (optional), Image (optional), and File (optional); the required Options module provides input widgets for other field modules. Additional fields and widgets may be provided by contributed modules, which you can find in the <a href=\"@contrib\">contributed module section of Drupal.org</a>. Currently enabled field and input widget modules:',	'',	'7.59'),
(389,	'/admin/modules',	'default',	'Managing field data storage',	'',	'7.59'),
(390,	'/admin/modules',	'default',	'Developers of field modules can either use the default <a href=\"@sql-store\">Field SQL storage module</a> to store data for their fields, or a contributed or custom module developed using the <a href=\"@storage-api\">field storage API</a>.',	'',	'7.59'),
(391,	'/admin/modules',	'default',	'Field API to add fields to entities like nodes and users.',	'',	'7.59'),
(392,	'/admin/modules',	'default',	'The Field SQL storage module stores field data in the database. It is the default field storage module; other field storage mechanisms may be available as contributed modules. See the <a href=\"@field-help\">Field module help page</a> for more information about fields.',	'',	'7.59'),
(393,	'/admin/modules',	'default',	'Stores field data in an SQL database.',	'',	'7.59'),
(394,	'/admin/modules',	'default',	'The Field UI module provides an administrative user interface (UI) for attaching and managing fields. Fields can be defined at the content-type level for content items and comments, at the vocabulary level for taxonomy terms, and at the site level for user accounts. Other modules may also enable fields to be defined for their data. Field types (text, image, number, etc.) are defined by modules, and collected and managed by the <a href=\"@field\">Field module</a>. For more information, see the online handbook entry for <a href=\"@field_ui\" target=\"_blank\">Field UI module</a>.',	'',	'7.59'),
(395,	'/admin/modules',	'default',	'Planning fields',	'',	'7.59'),
(396,	'/admin/modules',	'default',	'There are several decisions you will need to make before defining a field for content, comments, etc.:',	'',	'7.59'),
(397,	'/admin/modules',	'default',	'What the field will be called',	'',	'7.59'),
(398,	'/admin/modules',	'default',	'A field has a <em>label</em> (the name displayed in the user interface) and a <em>machine name</em> (the name used internally). The label can be changed after you create the field, if needed, but the machine name cannot be changed after you have created the field.',	'',	'7.59'),
(399,	'/admin/modules',	'default',	'What type of data the field will store',	'',	'7.59'),
(400,	'/admin/modules',	'default',	'Each field can store one type of data (text, number, file, etc.). When you define a field, you choose a particular <em>field type</em>, which corresponds to the type of data you want to store. The field type cannot be changed after you have created the field.',	'',	'7.59'),
(401,	'/admin/modules',	'default',	'How the data will be input and displayed',	'',	'7.59'),
(402,	'/admin/modules',	'default',	'Each field type has one or more available <em>widgets</em> associated with it; each widget provides a mechanism for data input when you are editing (text box, select list, file upload, etc.). Each field type also has one or more display options, which determine how the field is displayed to site visitors. The widget and display options can be changed after you have created the field.',	'',	'7.59'),
(403,	'/admin/modules',	'default',	'How many values the field will store',	'',	'7.59'),
(404,	'/admin/modules',	'default',	'You can store one value, a specific maximum number of values, or an unlimited number of values in each field. For example, an employee identification number field might store a single number, whereas a phone number field might store multiple phone numbers. This setting can be changed after you have created the field, but if you reduce the maximum number of values, you may lose information.',	'',	'7.59'),
(405,	'/admin/modules',	'default',	'Reusing fields',	'',	'7.59'),
(406,	'/admin/modules',	'default',	'Once you have defined a field, you can reuse it. For example, if you define a custom image field for one content type, and you need to have an image field with the same parameters on another content type, you can add the same field to the second content type, in the <em>Add existing field</em> area of the user interface. You could also add this field to a taxonomy vocabulary, comments, user accounts, etc.',	'',	'7.59'),
(407,	'/admin/modules',	'default',	'Some settings of a reused field are unique to each use of the field; others are shared across all places you use the field. For example, the label of a text field is unique to each use, while the setting for the number of values is shared.',	'',	'7.59'),
(408,	'/admin/modules',	'default',	'There are two main reasons for reusing fields. First, reusing fields can save you time over defining new fields. Second, reusing fields also allows you to display, filter, group, and sort content together by field across content types. For example, the contributed Views module allows you to create lists and tables of content. So if you use the same field on multiple content types, you can create a View containing all of those content types together displaying that field, sorted by that field, and/or filtered by that field.',	'',	'7.59'),
(409,	'/admin/modules',	'default',	'Fields on content items',	'',	'7.59'),
(410,	'/admin/modules',	'default',	'Fields on content items are defined at the content-type level, on the <em>Manage fields</em> tab of the content type edit page (which you can reach from the <a href=\"@types\">Content types page</a>). When you define a field for a content type, each content item of that type will have that field added to it. Some fields, such as the Title and Body, are provided for you when you create a content type, or are provided on content types created by your installation profile.',	'',	'7.59'),
(411,	'/admin/modules',	'default',	'Fields on taxonomy terms',	'',	'7.59'),
(412,	'/admin/modules',	'default',	'Fields on taxonomy terms are defined at the taxonomy vocabulary level, on the <em>Manage fields</em> tab of the vocabulary edit page (which you can reach from the <a href=\"@taxonomy\">Taxonomy page</a>). When you define a field for a vocabulary, each term in that vocabulary will have that field added to it. For example, you could define an image field for a vocabulary to store an icon with each term.',	'',	'7.59'),
(413,	'/admin/modules',	'default',	'Fields on user accounts',	'',	'7.59'),
(414,	'/admin/modules',	'default',	'Fields on user accounts are defined on a site-wide basis on the <a href=\"@fields\">Manage fields tab</a> of the <a href=\"@accounts\">Account settings</a> page. When you define a field for user accounts, each user account will have that field added to it. For example, you could add a long text field to allow users to include a biography.',	'',	'7.59'),
(415,	'/admin/modules',	'default',	'Fields on comments',	'',	'7.59'),
(416,	'/admin/modules',	'default',	'Fields on comments are defined at the content-type level, on the <em>Comment fields</em> tab of the content type edit page (which you can reach from the <a href=\"@types\">Content types page</a>). When you add a field for comments, each comment on a content item of that type will have that field added to it. For example, you could add a website field to the comments on forum posts, to allow forum commenters to add a link to their website.',	'',	'7.59'),
(417,	'/admin/modules',	'default',	'User interface for the Field API.',	'',	'7.59'),
(418,	'/admin/modules',	'default',	'The File module defines a <em>File</em> field type for the Field module, which lets you manage and validate uploaded files attached to content on your site (see the <a href=\"@field-help\">Field module help page</a> for more information about fields). For more information, see the online handbook entry for <a href=\"@file\">File module</a>.',	'',	'7.59'),
(419,	'/admin/modules',	'default',	'Attaching files to content',	'',	'7.59'),
(420,	'/admin/modules',	'default',	'The File module allows users to attach files to content (e.g., PDF files, spreadsheets, etc.), when a <em>File</em> field is added to a given content type using the <a href=\"@fieldui-help\">Field UI module</a>. You can add validation options to your File field, such as specifying a maximum file size and allowed file extensions.',	'',	'7.59'),
(421,	'/admin/modules',	'default',	'Managing attachment display',	'',	'7.59'),
(422,	'/admin/modules',	'default',	'When you attach a file to content, you can specify whether it is <em>listed</em> or not. Listed files are displayed automatically in a section at the bottom of your content; non-listed files are available for embedding in your content, but are not included in the list at the bottom.',	'',	'7.59'),
(423,	'/admin/modules',	'default',	'Managing file locations',	'',	'7.59'),
(424,	'/admin/modules',	'default',	'When you create a File field, you can specify a directory where the files will be stored, which can be within either the <em>public</em> or <em>private</em> files directory. Files in the public directory can be accessed directly through the web server; when public files are listed, direct links to the files are used, and anyone who knows a file\'s URL can download the file. Files in the private directory are not accessible directly through the web server; when private files are listed, the links are Drupal path requests. This adds to server load and download time, since Drupal must start up and resolve the path for each file download request, but allows for access restrictions.',	'',	'7.59'),
(425,	'/admin/modules',	'default',	'Defines a file field type.',	'',	'7.59'),
(426,	'/admin/modules',	'default',	'The Filter module allows administrators to configure text formats. A text format defines the HTML tags, codes, and other input allowed in content and comments, and is a key feature in guarding against potentially damaging input from malicious users. For more information, see the online handbook entry for <a href=\"@filter\">Filter module</a>.',	'',	'7.59'),
(427,	'/admin/modules',	'default',	'Configuring text formats',	'',	'7.59'),
(428,	'/admin/modules',	'default',	'Configure text formats on the <a href=\"@formats\">Text formats page</a>. <strong>Improper text format configuration is a security risk</strong>. To ensure security, untrusted users should only have access to text formats that restrict them to either plain text or a safe set of HTML tags, since certain HTML tags can allow embedding malicious links or scripts in text. More trusted registered users may be granted permission to use less restrictive text formats in order to create rich content.',	'',	'7.59'),
(429,	'/admin/modules',	'default',	'Applying filters to text',	'',	'7.59'),
(430,	'/admin/modules',	'default',	'Each text format uses filters to manipulate text, and most formats apply several different filters to text in a specific order. Each filter is designed for a specific purpose, and generally either adds, removes, or transforms elements within user-entered text before it is displayed. A filter does not change the actual content, but instead, modifies it temporarily before it is displayed. One filter may remove unapproved HTML tags, while another automatically adds HTML to make URLs display as clickable links.',	'',	'7.59'),
(431,	'/admin/modules',	'default',	'Defining text formats',	'',	'7.59'),
(432,	'/admin/modules',	'default',	'One format is included by default: <em>Plain text</em> (which removes all HTML tags). Additional formats may be created by your installation profile when you install Drupal, and more can be created by an administrator on the <a href=\"@text-formats\">Text formats page</a>.',	'',	'7.59'),
(433,	'/admin/modules',	'default',	'Choosing a text format',	'',	'7.59'),
(434,	'/admin/modules',	'default',	'Users with access to more than one text format can use the <em>Text format</em> fieldset to choose between available text formats when creating or editing multi-line content. Administrators can define the text formats available to each user role, and control the order of formats listed in the <em>Text format</em> fieldset on the <a href=\"@text-formats\">Text formats page</a>.',	'',	'7.59'),
(435,	'/admin/modules',	'default',	'Filters content in preparation for display.',	'',	'7.59'),
(436,	'/admin/modules',	'default',	'Provides discussion forums.',	'',	'7.59'),
(437,	'/admin/modules',	'default',	'The Help module provides <a href=\"@help-page\">Help reference pages</a> and context-sensitive advice to guide you through the use and configuration of modules. It is a starting point for the online <a href=\"@handbook\">Drupal handbooks</a>. The handbooks contain more extensive and up-to-date information, are annotated with user-contributed comments, and serve as the definitive reference point for all Drupal documentation. For more information, see the online handbook entry for the <a href=\"@help\">Help module</a>.',	'',	'7.59'),
(438,	'/admin/modules',	'default',	'Providing a help reference',	'',	'7.59'),
(439,	'/admin/modules',	'default',	'The Help module displays explanations for using each module listed on the main <a href=\"@help\">Help reference page</a>.',	'',	'7.59'),
(440,	'/admin/modules',	'default',	'Providing context-sensitive help',	'',	'7.59'),
(441,	'/admin/modules',	'default',	'The Help module displays context-sensitive advice and explanations on various pages.',	'',	'7.59'),
(442,	'/admin/modules',	'default',	'Manages the display of online help.',	'',	'7.59'),
(443,	'/admin/modules',	'default',	'The Image module allows you to manipulate images on your website. It exposes a setting for using the <em>Image toolkit</em>, allows you to configure <em>Image styles</em> that can be used for resizing or adjusting images on display, and provides an <em>Image</em> field for attaching images to content. For more information, see the online handbook entry for <a href=\"@image\">Image module</a>.',	'',	'7.59'),
(444,	'/admin/modules',	'default',	'Manipulating images',	'',	'7.59'),
(445,	'/admin/modules',	'default',	'With the Image module you can scale, crop, resize, rotate and desaturate images without affecting the original image using <a href=\"@image\">image styles</a>. When you change an image style, the module automatically refreshes all created images. Every image style must have a name, which will be used in the URL of the generated images. There are two common approaches to naming image styles (which you use will depend on how the image style is being applied):',	'',	'7.59'),
(446,	'/admin/modules',	'default',	'Based on where it will be used: eg. <em>profile-picture</em>',	'',	'7.59'),
(447,	'/admin/modules',	'default',	'Describing its appearance: eg. <em>square-85x85</em>',	'',	'7.59'),
(448,	'/admin/modules',	'default',	'After you create an image style, you can add effects: crop, scale, resize, rotate, and desaturate (other contributed modules provide additional effects). For example, by combining effects as crop, scale, and desaturate, you can create square, grayscale thumbnails.',	'',	'7.59'),
(449,	'/admin/modules',	'default',	'Attaching images to content as fields',	'',	'7.59'),
(450,	'/admin/modules',	'default',	'Image module also allows you to attach images to content as fields. To add an image field to a <a href=\'@content-type\'>content type</a>, go to the content type\'s <em>manage fields</em> page, and add a new field of type <em>Image</em>. Attaching images to content this way allows image styles to be applied and maintained, and also allows you more flexibility when theming.',	'',	'7.59'),
(451,	'/admin/modules',	'default',	'Provides image manipulation tools.',	'',	'7.59'),
(452,	'/admin/modules',	'default',	'The List module defines various fields for storing a list of items, for use with the Field module. Usually these items are entered through a select list, checkboxes, or radio buttons. See the <a href=\"@field-help\">Field module help page</a> for more information about fields.',	'',	'7.59'),
(453,	'/admin/modules',	'default',	'Defines list field types. Use with Options to create selection lists.',	'',	'7.59'),
(454,	'/admin/modules',	'default',	'The Locale module allows your Drupal site to be presented in languages other than the default English, and to be multilingual. The Locale module works by maintaining a database of translations, and examining text as it is about to be displayed. When a translation of the text is available in the language to be displayed, the translation is displayed rather than the original text. When a translation is unavailable, the original text is displayed, and then stored for review by a translator. For more information, see the online handbook entry for <a href=\"@locale\">Locale module</a>.',	'',	'7.59'),
(455,	'/admin/modules',	'default',	'Translating interface text',	'',	'7.59'),
(456,	'/admin/modules',	'default',	'Translations of text in the Drupal interface may be provided by:',	'',	'7.59'),
(457,	'/admin/modules',	'default',	'Translating within your site, using the Locale module\'s integrated <a href=\'@translate\'>translation interface</a>.',	'',	'7.59'),
(458,	'/admin/modules',	'default',	'Importing files from a set of existing translations, known as a translation package. A translation package enables the display of a specific version of Drupal in a specific language, and contains files in the Gettext Portable Object (<em>.po</em>) format. Although not all languages are available for every version of Drupal, translation packages for many languages are available for download from the <a href=\"@translations\">Drupal translations page</a>.',	'',	'7.59'),
(459,	'/admin/modules',	'default',	'If an existing translation package does not meet your needs, the Gettext Portable Object (<em>.po</em>) files within a package may be modified, or new <em>.po</em> files may be created, using a desktop Gettext editor. The Locale module\'s <a href=\'@import\'>import</a> feature allows the translated strings from a new or modified <em>.po</em> file to be added to your site. The Locale module\'s <a href=\'@export\'>export</a> feature generates files from your site\'s translated strings, that can either be shared with others or edited offline by a Gettext translation editor.',	'',	'7.59'),
(460,	'/admin/modules',	'default',	'Configuring a multilingual site',	'',	'7.59'),
(461,	'/admin/modules',	'default',	'Language negotiation allows your site to automatically change language based on the domain or path used for each request. Users may (optionally) select their preferred language on their <em>My account</em> page, and your site can be configured to honor a web browser\'s preferred language settings. Site content can be translated using the <a href=\'@content-help\'>Content translation module</a>.',	'',	'7.59'),
(462,	'/admin/modules',	'default',	'Adds language handling functionality and enables the translation of the user interface to languages other than English.',	'',	'7.59'),
(463,	'/admin/modules',	'default',	'The Menu module provides an interface for managing menus. A menu is a hierarchical collection of links, which can be within or external to the site, generally used for navigation. Each menu is rendered in a block that can be enabled and positioned through the <a href=\"@blocks\">Blocks administration page</a>. You can view and manage menus on the <a href=\"@menus\">Menus administration page</a>. For more information, see the online handbook entry for the <a href=\"@menu\">Menu module</a>.',	'',	'7.59'),
(464,	'/admin/modules',	'default',	'Managing menus',	'',	'7.59'),
(465,	'/admin/modules',	'default',	'Users with the <em>Administer menus and menu items</em> permission can add, edit and delete custom menus on the <a href=\"@menu\">Menus administration page</a>. Custom menus can be special site menus, menus of external links, or any combination of internal and external links. You may create an unlimited number of additional menus, each of which will automatically have an associated block. By selecting <em>list links</em>, you can add, edit, or delete links for a given menu. The links listing page provides a drag-and-drop interface for controlling the order of links, and creating a hierarchy within the menu.',	'',	'7.59'),
(466,	'/admin/modules',	'default',	'Displaying menus',	'',	'7.59'),
(467,	'/admin/modules',	'default',	'After you have created a menu, you must enable and position the associated block on the <a href=\"@blocks\">Blocks administration page</a>.',	'',	'7.59'),
(468,	'/admin/modules',	'default',	'Allows administrators to customize the site navigation menu.',	'',	'7.59'),
(469,	'/admin/modules',	'default',	'Use nodes as dropdown menus.',	'',	'7.59'),
(470,	'/admin/modules',	'default',	'CSS/jQuery drop-down, drop-right and drop-left menus to be placed in blocks',	'',	'7.59'),
(471,	'/admin/modules',	'default',	'The Node module manages the creation, editing, deletion, settings, and display of the main site content. Content items managed by the Node module are typically displayed as pages on your site, and include a title, some meta-data (author, creation time, content type, etc.), and optional fields containing text or other data (fields are managed by the <a href=\"@field\">Field module</a>). For more information, see the online handbook entry for <a href=\"@node\">Node module</a>.',	'',	'7.59'),
(472,	'/admin/modules',	'default',	'Creating content',	'',	'7.59'),
(473,	'/admin/modules',	'default',	'When new content is created, the Node module records basic information about the content, including the author, date of creation, and the <a href=\"@content-type\">Content type</a>. It also manages the <em>publishing options</em>, which define whether or not the content is published, promoted to the front page of the site, and/or sticky at the top of content lists. Default settings can be configured for each <a href=\"@content-type\">type of content</a> on your site.',	'',	'7.59'),
(474,	'/admin/modules',	'default',	'Creating custom content types',	'',	'7.59'),
(475,	'/admin/modules',	'default',	'The Node module gives users with the <em>Administer content types</em> permission the ability to <a href=\"@content-new\">create new content types</a> in addition to the default ones already configured. Creating custom content types allows you the flexibility to add <a href=\"@field\">fields</a> and configure default settings that suit the differing needs of various site content.',	'',	'7.59'),
(476,	'/admin/modules',	'default',	'Administering content',	'',	'7.59'),
(477,	'/admin/modules',	'default',	'The <a href=\"@content\">Content administration page</a> allows you to review and bulk manage your site content.',	'',	'7.59'),
(478,	'/admin/modules',	'default',	'Creating revisions',	'',	'7.59'),
(479,	'/admin/modules',	'default',	'The Node module also enables you to create multiple versions of any content, and revert to older versions using the <em>Revision information</em> settings.',	'',	'7.59'),
(480,	'/admin/modules',	'default',	'User permissions',	'',	'7.59'),
(481,	'/admin/modules',	'default',	'The Node module makes a number of permissions available for each content type, which can be set by role on the <a href=\"@permissions\">permissions page</a>.',	'',	'7.59'),
(482,	'/admin/modules',	'default',	'Allows content to be submitted to the site and displayed on pages.',	'',	'7.59'),
(483,	'/admin/modules',	'default',	'The Number module defines various numeric field types for the Field module. Numbers can be in integer, decimal, or floating-point form, and they can be formatted when displayed. Number fields can be limited to a specific set of input values or to a range of values. See the <a href=\"@field-help\">Field module help page</a> for more information about fields.',	'',	'7.59'),
(484,	'/admin/modules',	'default',	'Defines numeric field types.',	'',	'7.59'),
(485,	'/admin/modules',	'default',	'Allows users to log into your site using OpenID.',	'',	'7.59'),
(486,	'/admin/modules',	'default',	'The Options module defines checkbox, selection, and other input widgets for the Field module. See the <a href=\"@field-help\">Field module help page</a> for more information about fields.',	'',	'7.59'),
(487,	'/admin/modules',	'default',	'Defines selection, check box and radio button widgets for text and numeric fields.',	'',	'7.59'),
(488,	'/admin/modules',	'default',	'Displays the Drupal administration interface in an overlay.',	'',	'7.59'),
(489,	'/admin/modules',	'default',	'The Path module allows you to specify an alias, or custom URL, for any existing internal system path. Aliases should not be confused with URL redirects, which allow you to forward a changed or inactive URL to a new URL. In addition to making URLs more readable, aliases also help search engines index content more effectively. Multiple aliases may be used for a single internal system path. To automate the aliasing of paths, you can install the contributed module <a href=\"@pathauto\">Pathauto</a>. For more information, see the online handbook entry for the <a href=\"@path\">Path module</a>.',	'',	'7.59'),
(490,	'/admin/modules',	'default',	'Creating aliases',	'',	'7.59'),
(491,	'/admin/modules',	'default',	'Users with sufficient <a href=\"@permissions\">permissions</a> can create aliases under the <em>URL path settings</em> section when they create or edit content. Some examples of aliases are: ',	'',	'7.59'),
(492,	'/admin/modules',	'default',	'<em>member/jane-smith</em> aliased to internal path <em>user/123</em>',	'',	'7.59'),
(493,	'/admin/modules',	'default',	'<em>about-us/team</em> aliased to internal path <em>node/456</em>',	'',	'7.59'),
(494,	'/admin/modules',	'default',	'Managing aliases',	'',	'7.59'),
(495,	'/admin/modules',	'default',	'The Path module provides a way to search and view a <a href=\"@aliases\">list of all aliases</a> that are in use on your website. Aliases can be added, edited and deleted through this list.',	'',	'7.59'),
(496,	'/admin/modules',	'default',	'Allows users to rename URLs.',	'',	'7.59'),
(497,	'/admin/modules',	'default',	'Allows embedded PHP code/snippets to be evaluated.',	'',	'7.59'),
(498,	'/admin/modules',	'default',	'Allows your site to capture votes on different topics in the form of multiple choice questions.',	'',	'7.59'),
(499,	'/admin/modules',	'default',	'The RDF module enriches your content with metadata to let other applications (e.g., search engines, aggregators, and so on) better understand its relationships and attributes. This semantically enriched, machine-readable output for Drupal sites uses the <a href=\"@rdfa\">RDFa specification</a> which allows RDF data to be embedded in HTML markup. Other modules can define mappings of their data to RDF terms, and the RDF module makes this RDF data available to the theme. The core Drupal modules define RDF mappings for their data model, and the core Drupal themes output this RDF metadata information along with the human-readable visual information. For more information, see the online handbook entry for <a href=\"@rdf\">RDF module</a>.',	'',	'7.59'),
(500,	'/admin/modules',	'default',	'Enriches your content with metadata to let other applications (e.g. search engines, aggregators) better understand its relationships and attributes.',	'',	'7.59'),
(501,	'/admin/modules',	'default',	'The Search module provides the ability to index and search for content by exact keywords, and for users by username or e-mail. For more information, see the online handbook entry for <a href=\"@search-module\">Search module</a>.',	'',	'7.59'),
(502,	'/admin/modules',	'default',	'Searching content and users',	'',	'7.59'),
(503,	'/admin/modules',	'default',	'Users with <em>Use search</em> permission can use the search block and <a href=\"@search\">Search page</a>. Users with the <em>View published content</em> permission can search for content containing exact keywords. Users with the <em>View user profiles</em> permission can search for users containing the keyword anywhere in the user name, and users with the <em>Administer users</em> permission can search for users by email address. Additionally, users with <em>Use advanced search</em> permission can find content using more complex search methods and filtering by choosing the <em>Advanced search</em> option on the <a href=\"@search\">Search page</a>.',	'',	'7.59'),
(504,	'/admin/modules',	'default',	'Indexing content with cron',	'',	'7.59'),
(505,	'/admin/modules',	'default',	'To provide keyword searching, the search engine maintains an index of words found in the content and its fields, along with text added to your content by other modules (such as comments from the core Comment module, and taxonomy terms from the core Taxonomy module). To build and maintain this index, a correctly configured <a href=\"@cron\">cron maintenance task</a> is required. Users with <em>Administer search</em> permission can further configure the cron settings on the <a href=\"@searchsettings\">Search settings page</a>.',	'',	'7.59'),
(506,	'/admin/modules',	'default',	'Content reindexing',	'',	'7.59'),
(507,	'/admin/modules',	'default',	'Content-related actions on your site (creating, editing, or deleting content and comments) automatically cause affected content items to be marked for indexing or reindexing at the next cron run. When content is marked for reindexing, the previous content remains in the index until cron runs, at which time it is replaced by the new content. Unlike content-related actions, actions related to the structure of your site do not cause affected content to be marked for reindexing. Examples of structure-related actions that affect content include deleting or editing taxonomy terms, enabling or disabling modules that add text to content (such as Taxonomy, Comment, and field-providing modules), and modifying the fields or display parameters of your content types. If you take one of these actions and you want to ensure that the search index is updated to reflect your changed site structure, you can mark all content for reindexing by clicking the \"Re-index site\" button on the <a href=\"@searchsettings\">Search settings page</a>. If you have a lot of content on your site, it may take several cron runs for the content to be reindexed.',	'',	'7.59'),
(508,	'/admin/modules',	'default',	'Configuring search settings',	'',	'7.59'),
(509,	'/admin/modules',	'default',	'Indexing behavior can be adjusted using the <a href=\"@searchsettings\">Search settings page</a>. Users with <em>Administer search</em> permission can control settings such as the <em>Number of items to index per cron run</em>, <em>Indexing settings</em> (word length), <em>Active search modules</em>, and <em>Content ranking</em>, which lets you adjust the priority in which indexed content is returned in results.',	'',	'7.59'),
(510,	'/admin/modules',	'default',	'Search block',	'',	'7.59'),
(511,	'/admin/modules',	'default',	'The Search module includes a default <em>Search form</em> block, which can be enabled and configured on the <a href=\"@blocks\">Blocks administration page</a>. The block is available to users with the <em>Search content</em> permission.',	'',	'7.59'),
(512,	'/admin/modules',	'default',	'Extending Search module',	'',	'7.59'),
(513,	'/admin/modules',	'default',	'By default, the Search module only supports exact keyword matching in content searches. You can modify this behavior by installing a language-specific stemming module for your language (such as <a href=\"http://drupal.org/project/porterstemmer\">Porter Stemmer</a> for American English), which allows words such as walk, walking, and walked to be matched in the Search module. Another approach is to use a third-party search technology with stemming or partial word matching features built in, such as <a href=\"http://drupal.org/project/apachesolr\">Apache Solr</a> or <a href=\"http://drupal.org/project/sphinx\">Sphinx</a>. These and other <a href=\"@contrib-search\">search-related contributed modules</a> can be downloaded by visiting Drupal.org.',	'',	'7.59'),
(514,	'/admin/modules',	'default',	'Enables site-wide keyword searching.',	'',	'7.59'),
(515,	'/admin/modules',	'default',	'The Shortcut module allows users to create sets of <em>shortcut</em> links to commonly-visited pages of the site. Shortcuts are contained within <em>sets</em>. Each user with <em>Select any shortcut set</em> permission can select a shortcut set created by anyone at the site. For more information, see the online handbook entry for <a href=\"@shortcut\">Shortcut module</a>.',	'',	'7.59'),
(516,	'/admin/modules',	'default',	'Administering shortcuts',	'',	'7.59'),
(517,	'/admin/modules',	'default',	'Users with the <em>Administer shortcuts</em> permission can manage shortcut sets and edit the shortcuts within sets from the <a href=\"@shortcuts\">Shortcuts administration page</a>.',	'',	'7.59'),
(518,	'/admin/modules',	'default',	'Choosing shortcut sets',	'',	'7.59'),
(519,	'/admin/modules',	'default',	'Users with permission to switch shortcut sets can choose a shortcut set to use from the Shortcuts tab of their user account page.',	'',	'7.59'),
(520,	'/admin/modules',	'default',	'Adding and removing shortcuts',	'',	'7.59'),
(521,	'/admin/modules',	'default',	'The Shortcut module creates an add/remove link for each page on your site; the link lets you add or remove the current page from the currently-enabled set of shortcuts (if your theme displays it and you have permission to edit your shortcut set). The core Seven administration theme displays this link next to the page title, as a small + or - sign. If you click on the + sign, you will add that page to your preferred set of shortcuts. If the page is already part of your shortcut set, the link will be a - sign, and will allow you to remove the current page from your shortcut set.',	'',	'7.59'),
(522,	'/admin/modules',	'default',	'Displaying shortcuts',	'',	'7.59'),
(523,	'/admin/modules',	'default',	'You can display your shortcuts by enabling the Shortcuts block on the <a href=\"@blocks\">Blocks administration page</a>. Certain administrative modules also display your shortcuts; for example, the core <a href=\"@toolbar-help\">Toolbar module</a> displays them near the top of the page, along with an <em>Edit shortcuts</em> link.',	'',	'7.59'),
(524,	'/admin/modules',	'default',	'Allows users to manage customizable lists of shortcut links.',	'',	'7.59'),
(525,	'/admin/modules',	'default',	'Logs access statistics for your site.',	'',	'7.59'),
(526,	'/admin/modules',	'default',	'Logs and records system events to syslog.',	'',	'7.59'),
(527,	'/admin/modules',	'default',	'The System module is integral to the site, and provides basic but extensible functionality for use by other modules and themes. Some integral elements of Drupal are contained in and managed by the System module, including caching, enabling and disabling modules and themes, preparing and displaying the administrative page, and configuring fundamental site settings. A number of key system maintenance operations are also part of the System module. For more information, see the online handbook entry for <a href=\"@system\">System module</a>.',	'',	'7.59'),
(528,	'/admin/modules',	'default',	'Managing modules',	'',	'7.59'),
(529,	'/admin/modules',	'default',	'The System module allows users with the appropriate permissions to enable and disable modules on the <a href=\"@modules\">Modules administration page</a>. Drupal comes with a number of core modules, and each module provides a discrete set of features and may be enabled or disabled depending on the needs of the site. Many additional modules contributed by members of the Drupal community are available for download at the <a href=\"@drupal-modules\">Drupal.org module page</a>.',	'',	'7.59'),
(530,	'/admin/modules',	'default',	'Managing themes',	'',	'7.59'),
(531,	'/admin/modules',	'default',	'The System module allows users with the appropriate permissions to enable and disable themes on the <a href=\"@themes\">Appearance administration page</a>. Themes determine the design and presentation of your site. Drupal comes packaged with several core themes, and additional contributed themes are available at the <a href=\"@drupal-themes\">Drupal.org theme page</a>.',	'',	'7.59'),
(532,	'/admin/modules',	'default',	'Managing caching',	'',	'7.59'),
(533,	'/admin/modules',	'default',	'The System module allows users with the appropriate permissions to manage caching on the <a href=\'@cache-settings\'>Performance settings page</a>. Drupal has a robust caching system that allows the efficient re-use of previously-constructed web pages and web page components. Pages requested by anonymous users are stored in a compressed format; depending on your site configuration and the amount of your web traffic tied to anonymous visitors, the caching system may significantly increase the speed of your site.',	'',	'7.59'),
(534,	'/admin/modules',	'default',	'Performing system maintenance',	'',	'7.59'),
(535,	'/admin/modules',	'default',	'In order for the site and its modules to continue to operate well, a set of routine administrative operations must run on a regular basis. The System module manages this task by making use of a system cron job. You can verify the status of cron tasks by visiting the <a href=\"@status\">Status report page</a>. For more information, see the online handbook entry for <a href=\"@handbook\">configuring cron jobs</a>. You can set up cron job by visiting <a href=\"@cron\">Cron configuration</a> page',	'',	'7.59'),
(536,	'/admin/modules',	'default',	'Configuring basic site settings',	'',	'7.59'),
(537,	'/admin/modules',	'default',	'The System module also handles basic configuration options for your site, including <a href=\"@date-time-settings\">Date and time settings</a>, <a href=\"@file-system\">File system settings</a>, <a href=\"@clean-url\">Clean URL support</a>, <a href=\"@site-info\">Site name and other information</a>, and a <a href=\"@maintenance-mode\">Maintenance mode</a> for taking your site temporarily offline.',	'',	'7.59'),
(538,	'/admin/modules',	'default',	'Configuring actions',	'',	'7.59'),
(539,	'/admin/modules',	'default',	'Actions are individual tasks that the system can do, such as unpublishing a piece of content or banning a user. Modules, such as the <a href=\"@trigger-help\">Trigger module</a>, can fire these actions when certain system events happen; for example, when a new post is added or when a user logs in. Modules may also provide additional actions. Visit the <a href=\"@actions\">Actions page</a> to configure actions.',	'',	'7.59'),
(540,	'/admin/modules',	'default',	'Handles general site configuration for administrators.',	'',	'7.59'),
(541,	'/admin/modules',	'default',	'The Taxonomy module allows you to classify the content of your website. To classify content, you define <em>vocabularies</em> that contain related <em>terms</em>, and then assign the vocabularies to content types. For more information, see the online handbook entry for the <a href=\"@taxonomy\">Taxonomy module</a>.',	'',	'7.59'),
(542,	'/admin/modules',	'default',	'Creating vocabularies',	'',	'7.59'),
(543,	'/admin/modules',	'default',	'Users with sufficient <a href=\"@perm\">permissions</a> can create <em>vocabularies</em> and <em>terms</em> through the <a href=\"@taxo\">Taxonomy page</a>. The page listing the terms provides a drag-and-drop interface for controlling the order of the terms and sub-terms within a vocabulary, in a hierarchical fashion. A <em>controlled vocabulary</em> classifying music by genre with terms and sub-terms could look as follows:',	'',	'7.59'),
(544,	'/admin/modules',	'default',	'<em>vocabulary</em>: Music',	'',	'7.59'),
(545,	'/admin/modules',	'default',	'<em>term</em>: Jazz',	'',	'7.59'),
(546,	'/admin/modules',	'default',	'<em>sub-term</em>: Swing',	'',	'7.59'),
(547,	'/admin/modules',	'default',	'<em>sub-term</em>: Fusion',	'',	'7.59'),
(548,	'/admin/modules',	'default',	'<em>term</em>: Rock',	'',	'7.59'),
(549,	'/admin/modules',	'default',	'<em>sub-term</em>: Country rock',	'',	'7.59'),
(550,	'/admin/modules',	'default',	'<em>sub-term</em>: Hard rock',	'',	'7.59'),
(551,	'/admin/modules',	'default',	'You can assign a sub-term to multiple parent terms. For example, <em>fusion</em> can be assigned to both <em>rock</em> and <em>jazz</em>.',	'',	'7.59'),
(552,	'/admin/modules',	'default',	'Terms in a <em>free-tagging vocabulary</em> can be built gradually as you create or edit content. This is often done used for blogs or photo management applications.',	'',	'7.59'),
(553,	'/admin/modules',	'default',	'Assigning vocabularies to content types',	'',	'7.59'),
(554,	'/admin/modules',	'default',	'Before you can use a new vocabulary to classify your content, a new Taxonomy term field must be added to a <a href=\"@ctedit\">content type</a> on its <em>manage fields</em> page. When adding a taxonomy field, you choose a <em>widget</em> to use to enter the taxonomy information on the content editing page: a select list, checkboxes, radio buttons, or an auto-complete field (to build a free-tagging vocabulary). After choosing the field type and widget, on the subsequent <em>field settings</em> page you can choose the desired vocabulary, whether one or multiple terms can be chosen from the vocabulary, and other settings. The same vocabulary can be added to multiple content types, by using the \"Add existing field\" section on the manage fields page.',	'',	'7.59'),
(555,	'/admin/modules',	'default',	'Classifying content',	'',	'7.59'),
(556,	'/admin/modules',	'default',	'After the vocabulary is assigned to the content type, you can start classifying content. The field with terms will appear on the content editing screen when you edit or <a href=\"@addnode\">add new content</a>.',	'',	'7.59'),
(557,	'/admin/modules',	'default',	'Viewing listings and RSS feeds by term',	'',	'7.59'),
(558,	'/admin/modules',	'default',	'Each taxonomy term automatically provides a page listing content that has its classification, and a corresponding RSS feed. For example, if the taxonomy term <em>country rock</em> has the ID 123 (you can see this by looking at the URL when hovering on the linked term, which you can click to navigate to the listing page), then you will find this list at the path <em>taxonomy/term/123</em>. The RSS feed will use the path <em>taxonomy/term/123/feed</em> (the RSS icon for this term\'s listing will automatically display in your browser\'s address bar when viewing the listing page).',	'',	'7.59'),
(559,	'/admin/modules',	'default',	'Extending Taxonomy module',	'',	'7.59'),
(560,	'/admin/modules',	'default',	'There are <a href=\"@taxcontrib\">many contributed modules</a> that extend the behavior of the Taxonomy module for both display and organization of terms.',	'',	'7.59'),
(561,	'/admin/modules',	'default',	'Enables the categorization of content.',	'',	'7.59'),
(562,	'/admin/modules',	'default',	'Provides a framework for unit and functional testing.',	'',	'7.59'),
(563,	'/admin/modules',	'default',	'The Text module defines various text field types for the Field module. A text field may contain plain text only, or optionally, may use Drupal\'s <a href=\'@filter-help\'>text filters</a> to securely manage HTML output. Text input fields may be either a single line (text field), multiple lines (text area), or for greater input control, a select box, checkbox, or radio buttons. If desired, the field can be validated, so that it is limited to a set of allowed values. See the <a href=\'@field-help\'>Field module help page</a> for more information about fields.',	'',	'7.59'),
(564,	'/admin/modules',	'default',	'Defines simple text field types.',	'',	'7.59'),
(565,	'/admin/modules',	'default',	'Provides a toolbar that shows the top-level administration menu items and links from other modules.',	'',	'7.59'),
(566,	'/admin/modules',	'default',	'Enables tracking of recent content for users.',	'',	'7.59'),
(567,	'/admin/modules',	'default',	'Enables actions to be fired on certain system events, such as when new content is created.',	'',	'7.59'),
(568,	'/admin/modules',	'default',	'The Update manager module periodically checks for new versions of your site\'s software (including contributed modules and themes), and alerts administrators to available updates. In order to provide update information, anonymous usage statistics are sent to Drupal.org. If desired, you may disable the Update manager module from the <a href=\'@modules\'>Module administration page</a>. For more information, see the online handbook entry for <a href=\'@update\'>Update manager module</a>.',	'',	'7.59'),
(569,	'/admin/modules',	'default',	'The Update manager also allows administrators to update and install modules and themes through the administration interface.',	'',	'7.59'),
(570,	'/admin/modules',	'default',	'Checking for available updates',	'',	'7.59'),
(571,	'/admin/modules',	'default',	'A report of <a href=\"@update-report\">available updates</a> will alert you when new releases are available for download. You may configure options for the frequency for checking updates (which are performed during <a href=\"@cron\">cron</a> runs) and e-mail notifications at the <a href=\"@update-settings\">Update manager settings</a>  page.',	'',	'7.59'),
(572,	'/admin/modules',	'default',	'Performing updates through the user interface',	'',	'7.59'),
(573,	'/admin/modules',	'default',	'The Update manager module allows administrators to perform updates directly through the administration interface. At the top of the <a href=\"@modules_page\">modules</a> and <a href=\"@themes_page\">themes</a> pages you will see a link to update to new releases. This will direct you to the <a href=\"@update-page\">update page</a> where you see a listing of all the missing updates and confirm which ones you want to upgrade. From there, you are prompted for your FTP/SSH password, which then transfers the files into your Drupal installation, overwriting your old files. More detailed instructions can be found in the <a href=\"@update\">online handbook</a>.',	'',	'7.59'),
(574,	'/admin/modules',	'default',	'Installing new modules and themes through the user interface',	'',	'7.59'),
(575,	'/admin/modules',	'default',	'You can also install new modules and themes in the same fashion, through the <a href=\"@install\">install page</a>, or by clicking the <em>Install new module/theme</em> link at the top of the <a href=\"@modules_page\">modules</a> and <a href=\"@themes_page\">themes</a> pages. In this case, you are prompted to provide either the URL to the download, or to upload a packaged release file from your local computer.',	'',	'7.59'),
(576,	'/admin/modules',	'default',	'Checks for available updates, and can securely install or update modules and themes via a web interface.',	'',	'7.59'),
(577,	'/admin/modules',	'default',	'The User module allows users to register, log in, and log out. It also allows users with proper permissions to manage user roles (used to classify users) and permissions associated with those roles. For more information, see the online handbook entry for <a href=\"@user\">User module</a>.',	'',	'7.59'),
(578,	'/admin/modules',	'default',	'Creating and managing users',	'',	'7.59'),
(579,	'/admin/modules',	'default',	'The User module allows users with the appropriate <a href=\"@permissions\">permissions</a> to create user accounts through the <a href=\"@people\">People administration page</a>, where they can also assign users to one or more roles, and block or delete user accounts. If allowed, users without accounts (anonymous users) can create their own accounts on the <a href=\"@register\">Create new account</a> page.',	'',	'7.59'),
(580,	'/admin/modules',	'default',	'User roles and permissions',	'',	'7.59'),
(581,	'/admin/modules',	'default',	'<em>Roles</em> are used to group and classify users; each user can be assigned one or more roles. By default there are two roles: <em>anonymous user</em> (users that are not logged in) and <em>authenticated user</em> (users that are registered and logged in). Depending on choices you made when you installed Drupal, the installation process may have defined more roles, and you can create additional custom roles on the <a href=\"@roles\">Roles page</a>. After creating roles, you can set permissions for each role on the <a href=\"@permissions_user\">Permissions page</a>. Granting a permission allows users who have been assigned a particular role to perform an action on the site, such as viewing a particular type of content, editing or creating content, administering settings for a particular module, or using a particular function of the site (such as search).',	'',	'7.59'),
(582,	'/admin/modules',	'default',	'The <a href=\"@accounts\">Account settings page</a> allows you to manage settings for the displayed name of the anonymous user role, personal contact forms, user registration, and account cancellation. On this page you can also manage settings for account personalization (including signatures and user pictures), and adapt the text for the e-mail messages that are sent automatically during the user registration process.',	'',	'7.59'),
(583,	'/admin/modules',	'default',	'Manages the user registration and login system.',	'',	'7.59'),
(584,	'/admin/modules',	'default',	'Name',	'',	'7.59'),
(585,	'/admin/modules',	'default',	'Version',	'',	'7.59'),
(586,	'/admin/modules',	'default',	'Description',	'',	'7.59'),
