(589,	'/admin/modules',	'default',	'Download additional <a href=\"@modules\">contributed modules</a> to extend Drupal\'s functionality.',	'',	'7.59'),
(590,	'/admin/modules',	'default',	'Regularly review and install <a href=\"@updates\">available updates</a> to maintain a secure and current site. Always run the <a href=\"@update-php\">update script</a> each time a module is updated.',	'',	'7.59'),
(591,	'/admin/modules',	'default',	'Required by: !module-list',	'',	'7.59'),
